    export function getWordOfTheDay(): string {
        const answerCount = 2315;
        const current = new Date().getTime();
        const start = new Date(2022).getTime();
        return getWordListOnTheme("fiveLetter")!.array[Math.floor((current - start) / (1000 * 60 * 60 * 24)) % answerCount];
    }

    export function getWordListOnTheme(theme: string): WordList | undefined {
        return list.find(v => v.theme === theme);
    }

    export function getRandomWord(theme: string = "fiveLetter"): string {
        return getWordListOnTheme(theme)!.random();
    }

    export function getTotalWordCount(): number {
        let count = 0;
        list.forEach(v => count += v.array.length);
        return count;
    }

    export function getWordOnIndex(index: number): string {
        index = Math.abs(index) % getTotalWordCount();

        let i;
        for (i = 0; i < list.length && list[i].array.length <= index; i++) {
            index -= list[i].array.length;
        }
        return list[i].array[index];
    }

    export function getWordIndex(word: string) {
        for (let h = 0, i = 0; i < list.length; i++) {
            if (list[i].set.has(word)) {
                for (let j = 0; j < list[i].array.length; j++) {
                    if (list[i].array[j] === word) {
                        h += j;
                        return h;
                    }
                }
            }
            h += list[i].array.length;
        }
        return -1;
    }

    export function getWordCoordinates(word: string): { list: WordList, index: number } | undefined {
        const wordList = list.find(v => v.set.has(word));
        if (!wordList)
            return undefined;

        return { list: wordList, index: wordList.array.indexOf(word) };
    }
